--
-- This script needs to be executed only if MCDB is being used.
--

DROP TABLE IF EXISTS `cashpackages`;
DROP TABLE IF EXISTS `commodities`;

CREATE TABLE `commodities` (
  `sn` INT(11) NOT NULL,
  `itemid` INT(11) NOT NULL,
  `quantity` SMALLINT(6) NOT NULL,
  `price` INT(11) NOT NULL,
  `period` TINYINT(4) NOT NULL,
  `gender` TINYINT(2) NOT NULL,
  `onsale` TINYINT(1) NOT NULL,
  PRIMARY KEY (`sn`)
) ENGINE=InnoDB;

/*!40000 ALTER TABLE `commodities` DISABLE KEYS */;
/*!40000 ALTER TABLE `commodities` ENABLE KEYS */;

CREATE TABLE `cashpackages` (
  `id` INT(11) NOT NULL AUTO_INCREMENT,
  `package` INT(11) NOT NULL,
  `sn` INT(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY (`package`)
) ENGINE=InnoDB;

/*!40000 ALTER TABLE `cashpackages` DISABLE KEYS */;
/*!40000 ALTER TABLE `cashpackages` ENABLE KEYS */;